CREATE TABLE Employee (
                          id INT PRIMARY KEY,
                          dni VARCHAR(20) UNIQUE NOT NULL,
                          name VARCHAR(100),
                          password VARCHAR(255),
                          description VARCHAR(255),
                          salary VARCHAR(10),
                          phone VARCHAR(20),
                          url_image VARCHAR(255),
                          disponible BOOLEAN,
                          token VARCHAR(255)
);ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='tabla de empleados';

